import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

export default function NewPage() {
  return (
    <Box
      sx={{
        width: "100%",
        height: "100vh",
        backgroundColor: "#f5f5f5",
      }}
    >
      <AppBar position="static" color="default" elevation={1}>
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          <Typography
            variant="h6"
            component="div"
            sx={{
              display: "flex",
              alignItems: "center",
              fontWeight: "bold",
            }}
          >
            <Box
              sx={{
                width: 40,
                height: 40,
                backgroundColor: "#ccc",
                borderRadius: "50%",
                display: "inline-block",
                marginRight: 1,
              }}
            />
            Logo Placeholder
          </Typography>

          <Box sx={{ display: "flex", gap: 3 }}>
            <Button component={Link} to="/venues" color="inherit">
              Venues
            </Button>
            <Button component={Link} to="/hair" color="inherit">
              Hair
            </Button>
            <Button component={Link} to="/makeup" color="inherit">
              Makeup
            </Button>
            <Button component={Link} to="/photographers" color="inherit">
              Photographers
            </Button>
            <Button component={Link} to="/music" color="inherit">
              Music
            </Button>
          </Box>

          <IconButton color="inherit">
            <ShoppingCartIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "calc(100vh - 64px)",
          color: "#fff",
        }}
      >
        <Typography
          variant="h3"
          sx={{
            backgroundColor: "rgba(0, 0, 0, 0.6)",
            padding: 2,
            borderRadius: 2,
          }}
        >
          Welcome to Your New Page
        </Typography>
      </Box>
    </Box>
  );
}
